import React from "react"
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
//carta
const Carta = ({elementoUrl,elementoIP,cambiarElemento}) => {
    return(<>

            <div className="Carta">
            <Card className="text-center bg-secondary">
            <Card.Header>{elementoUrl}</Card.Header>
            <Card.Body>
                <Card.Text>
                    ip:{elementoIP}
                </Card.Text>
                <Button variant="dark" onClick={()=>{ cambiarElemento({ip:elementoIP,busqueda:elementoUrl}) }}>ver Pagina</Button>
            </Card.Body>
            </Card>   
            </div>
    </>)

}
export default  Carta
